import React from 'react'
import MonacoEditor from 'react-monaco-editor'
// import * as monaco from 'monaco-editor/esm/vs/editor/editor.api'
import Axios from 'axios'
import history from '../history'
import ReactLoading from 'react-loading'
import styled from 'styled-components'

class SingleAlgo extends React.Component {
  constructor(props) {
    super(props)
    //TODO: Load user solution from UserAlgo
    this.state = {
      userCode: '// Type your code...\n',
      tests: '',
      failureStatus: '',
      currentAlgo: {},
      prompt: 'Prompt',
      title: 'Title',
      examples: '',
      user: {},
      loading: true,
      errorMessage: '',
      bunny: false
    }
  }

  // axios post request
  onAttempt = async value => {
    try {
      this.setState({
        loading: false
      })
      const {data} = await Axios.post(
        `/api/algos/${this.props.match.params.algoId}`,
        {
          text: this.state.userCode
        }
      )
      this.setState({
        tests: data.allTests,
        failureStatus: data.failsStatus,
        loading: true,
        bunny: false,
        errorMessage: ''
      })
      if (data.allPassing) {
        await Axios.put(`/api/algos/${this.props.match.params.algoId}`)
        history.push(`/algopass/${this.props.match.params.algoId}`)
      }
    } catch (error) {
      this.setState({
        errorMessage: error,
        loading: true,
        tests: '',
        bunny: true
      })
    }
  }

  handleChange = value => {
    this.setState({
      userCode: value
    })
  }

  async componentDidMount() {
    let userSol
    const algoId = this.props.match.params.algoId
    const {data} = await Axios.get(`/api/algos/${algoId}`)
    if (data.userAlgo) {
      if (data.userAlgo.userSolution) {
        userSol = data.userAlgo.userSolution
      } else {
        userSol = data.defaultText
      }
    } else {
      userSol = data.defaultText
    }
    let status = false
    if (data.userAlgo !== null) {
      if (data.userAlgo.status && data.userAlgo.status !== 'pending') {
        status = true
      }
    }
    this.setState({
      title: data.name,
      prompt: data.prompt,
      examples: data.examples,
      userCode: userSol,
      user: data.findUser,
      submitted: status
    })
  }

  componentDidUpdate(prevProps) {
    if (prevProps.examples !== this.props.examples) {
      this.setState({
        examples: this.props.examples
      })
    }
  }

  render() {
    const options = {
      selectOnLineNumbers: true,
      minimap: {enabled: false},
      fontFamily: 'Fira Code',
      fontLigatures: true,
      fontSize: '16px'
    }
    return (
      <div>
        <Wrapper>
          <PromptBox>
            <Title>{this.state.title}</Title>
            <Prompt>{this.state.prompt}</Prompt>
            <Head>Example(s):</Head>
            <Details>
              {this.state.examples.split('\n').map(piece => (
                <div>
                  {piece} <br />
                </div>
              ))}
            </Details>

            <Gif>
              {this.state.failureStatus.length === 0 &&
              this.state.errorMessage.length === 0 &&
              this.state.tests.length === 0 &&
              !this.state.bunny ? null : (
                <Giffy src="data:image/gif;base64," />
              )}
              {this.state.failureStatus.length > 0 &&
              this.state.tests.length > 0 ? (
                <Message>
                  <NiceTry>Nice Try! Keep Coding</NiceTry>
                  <Review>Review the errors below:</Review>
                </Message>
              ) : this.state.failureStatus.length !== 0 ? (
                <Message>
                  <NiceTry>Nice Try! Keep Coding</NiceTry>
                  <Review>Review the errors below:</Review>
                </Message>
              ) : this.state.errorMessage.length !== 0 ? (
                <Message>
                  <Review>
                    Uh, oh... Looks like you have an infinite loop!
                  </Review>
                </Message>
              ) : this.state.tests.length !== 0 ? (
                <Message>
                  <NiceTry>Uh, oh... Looks like you have some error</NiceTry>
                  <Review>Review the console below:</Review>
                </Message>
              ) : null}
            </Gif>
          </PromptBox>

          <Editor>
            <MonacoEditor
              width="800"
              height="400"
              language="javascript"
              theme="fairyfloss"
              value={this.state.userCode}
              options={options}
              onChange={this.handleChange}
            />

            <Buttons>
              <Break href={`/algofail/${this.props.match.params.algoId}`}>
                <button className="button">
                  Give me a {'<br/>'}
                  <span />
                  <span />
                  <span />
                  <span />
                </button>
              </Break>

              {this.state.loading ? (
                <Attempt>
                  {this.state.submitted ? (
                    <Head>You have already submitted this problem</Head>
                  ) : (
                    <button
                      className="button"
                      onClick={() => this.onAttempt(this.state.userCode)}
                    >
                      Attempt
                      <span />
                      <span />
                      <span />
                      <span />
                    </button>
                  )}
                </Attempt>
              ) : (
                <a>
                  <ReactLoading type="bars" color="black" />
                </a>
              )}
            </Buttons>
            <Details>
              {this.state.errorMessage ? (
                <div> Timeout Error - Please check for infinite loop </div>
              ) : (
                <div />
              )}
            </Details>
          </Editor>
        </Wrapper>

        <TestWrapper>
          <Mocha>
            <TopWrapper>
              <Head>Assertion Errors: </Head>
              <a>
                <button
                  onClick={() => {
                    window.scrollTo(0, document.body.scrollHeight)
                  }}
                  className="button"
                >
                  See More
                  <span />
                  <span />
                  <span />
                  <span />
                </button>
              </a>
            </TopWrapper>
            <Test>
              {this.state.failureStatus.length === 0 ? null : (
                <div>
                  <br />
                  {this.state.failureStatus.split('\n').map(piece => (
                    <div>
                      {piece} <br />
                    </div>
                  ))}
                </div>
              )}
            </Test>
          </Mocha>

          <Console>
            <TopWrapper>
              <Head>Console: </Head>
              <a>
                <button
                  onClick={() => {
                    window.scrollTo(0, document.body.scrollHeight)
                  }}
                  className="button"
                >
                  See More
                  <span />
                  <span />
                  <span />
                  <span />
                </button>
              </a>
            </TopWrapper>
            {this.state.tests.length === 0 ? null : (
              <Details>
                {this.state.tests.split('\n').map(piece => (
                  <div>
                    {piece} <br />
                  </div>
                ))}
              </Details>
            )}
          </Console>
        </TestWrapper>
      </div>
    )
  }
}

export default SingleAlgo

